import { Component } from "react";
import './card-list.component.css';

class CardList extends Component {
    render() {
        const {monsters} = this.props 
        return (
        <div className="monster-container-main">
            {monsters.map((monster)=>(
                <div key={monster.id} className="monster-container-items">
                    <img alt={`monsters name is ${monster.name}`} src={`https://robohash.org/${monster.id}?set=set1&size=180x180`} />
                    <h1>{monster.name}</h1>
                    <h2>{monster.email}</h2>
                    <h3>{monster.website}</h3>
                </div>
            ))}
        </div>
        )
    }
}

export default CardList;
